    A good step up from the previous model

Reviewed in the United States on October 7, 2014Style: 45mm with Leather EarpadsVerified Purchase









    After the discontinuation of the CAD MH310, of which I own 3 pairs, I was interested to hear what the CAD MH320 would bring to the table.  The 310 were loosely based on a classic AKG design, whereas the 320 are more reminiscent of newer Audio Technica headphones.  Although the two sets of headphones have similar model numbers, the new MH320 couldn't be physically more different than the former MH310.The newer MH320 phones sit slightly looser on my head, making them more comfortable.  They are light and unobtrusive - much more so than the more bulky former model.  The earcups are a little smaller than the previous model, so if you have large ears, they may not be such a great fit for you, but they are just big enough to cover my ears and no bigger.  Unlike the MH310, which had a long straight cable, much of the cable on the new MH320 phones is coiled.  Personally I have never been a fan of coiled cables, as they tend to tangle and give less length, but at this early stage, the cable has yet to cause me any consternation.The sound?  Well, having spent a few hours with the new headphones and comparing them to the 310, the 320 are an improvement.  For me, the MH310 was a little too bright in the high mids, which had a tendancy to make vocalists sound over-sibilent and cymbals and other high frequency sounds a little aggressive and fatiguing.  The MH320 phones are much more subdued in that range.  They don't sound dull by any means, but when you A/B them with the prior model, you realise how over-done the upper mids and highs were in the MH310.  In the lower frequencies, the newer MH320 model matches the prodigious bass responce of the former model - no problems there.  I feel I could comfortably listen to these headphones for many hours without ear fatigue.  They sound full and very good for a set of closed back headphones.  I feel they offer slightly less sound isolation from ambient noise than the previous model, but in every other respect, they are an acoustic upgrade.As a good quality pair of budget headphones for tracking and some mixing duties, I would certainly these headphones.

